import './App.css';

import React from "react";


const templates = [{
  name: "test",
  snippet: "test"
}]

function App() {
  return (
    <div className="bg-gray-100 w-screen h-screen">
      <header className="w-full text-center text-base font-semibold"> Personal Snippets</header>
      {templates.map(template => {
        <div>
          <p>template.name</p>
          <p>template.snippet</p>
        </div>
      })}


    </div>
  );
}

export default App;
